response.body:
.text {
  color: #868686;
}

.tile:hover {
  outline: 3px solid #f00;
}

.tile:focus {
  outline: 3px solid blue;
}

div.box.container {
  border: 1px solid #F2F2F2;
}





/*button*/
button.button {
  background: #3fc679;
  color: #fff;
  padding: 12px 20px;
  border: none;
  border-radius: 0px;
  width: auto;
}

button.button:focus {
  outline: rgb(255, 0, 0) solid 2px;
  outline-offset: 2px;
}







/*home*/
.home h2.heading.text {
  color: #000;
  font-size: 30px;
}

.home path {
  display: none;
}

div.home.box.screen {
  margin-top: -10%;
}



/*tilegame Fail*/
div.tile-game-fail.box.screen {
  align-items: center;
}

div.alert.box {
  background: transparent;
}




/*progress*/
.progress div.progress-section-container,
.progress div.progress-section-fill {
  background: #fff;
  height: 16px;
  border-top: 1px solid #ccc;
  border-bottom: 1px solid #ccc;
}

.progress div.progress-section-fill {
  background: #3fc679;
  border-color: #3fc679;
}

.progress div.progress-section-container:first-child {
  border-top-left-radius: 10px;
  border-bottom-left-radius: 10px;
}

.progress div.progress-section-container:last-child {
  border-right: 1px solid #ccc;
  border-top-right-radius: 10px;
  border-bottom-right-radius: 10px;
}



/*Loading*/
div.loading.box.screen {
  border: 1px solid #666;
}

.loading svg.loading-spinner path {
  stroke: #3fc679;
}






/*audio-mode*/
.audio-mode button {
  padding: 8px 12px;
}

.audio-game button.button {
  border-radius: 0px;
  background: #3fc679;
  color: #fff;
  border: none;
}

.audio-game p.text,
.audio-game h2.heading.text {
  color: #1b242d;
  font-weight: normal;
}


.audio-game input.answer-input {
  border: none;
  border-bottom: 1px solid #000;
  border-radius: 0px;
  width: 50%;
  position: absolute;
  top: 48%;
  right: 6%;
}



.error p.text {
  max-width: 100%;
}

form.audio-game.box.screen {
  padding-top: 7%;
}

h2.audio-game-alert.text {
  color: red;
  font-size: 16px;
  margin-top: 5%;
  font-weight: normal;
  margin-bottom: -5%;
}

.audio-mode button.play-button {
  border-radius: 0px;
  background: #3fc679;
  color: #fff;
  border: none;
}

.audio-mode button.verify-button {
  border-radius: 0px;
  background: #3fc679;
  color: #fff;
  border: none;
}

.audio-mode button.download-button {
  border-radius: 0px;
  background: #3fc679;
  color: #fff;
  border: none;
}

.audio-mode a {
  color: #fff;
}

h2.audio-mode-alert.text {
  text-align: center;
  color: red;
  font-size: 16px;
  margin-top: 5%;
}

.audio-mode input {
  border: 1px solid #868686;
}





/*match game*/
.match-game h2.text {
  margin-top: 8%;
  margin-bottom: 0px;
}

.match-game button.button {
  margin-top: 0px;
  width: 100%;
}

h2.match-game-alert.text {
  margin-top: 3%;
  margin-bottom: -2%;
}

.match-game-fail p.text {
  font-weight: normal;
  margin-top: 5%;
}

.tile-game h2.text {
  font-weight: normal;
}


h2.tile-game-alert.text {
  margin-top: 7%;
}

.navigation path {
  fill: #868686;
}

/*media queries for smaller devices*/
@media screen and (max-width: 375px) {
  h2.tile-game-alert.text {
    font-size: 18px;
  }

  .home h2.heading.text {
    font-size: 23px;
  }
}

div.match-game.box.screen {
  padding-top: 14px;
  padding-bottom: 4px;
}

.match-game p.key-frame-text.text {
  color: #fff;
}

.match-game a.left-arrow,
.match-game a.right-arrow {
  margin-left: 2%;
  margin-right: 2%;
  margin-bottom: -22%;
}

.match-game div.pip-container {
  padding-top: 12px;
  height: 32px;
}

.match-game div.box.challenge-container {
  margin-top: 10px;
  margin-bottom: 16px;
}

.match-game button.button {}

/* Footer */
.navigation {
  height: auto;
  padding: 0 50px;
  padding-bottom: 0.7rem;
}

.navigation .icon-button {
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 0.25rem;
}

.navigation .icon-button svg {
  margin-right: 0.5rem;
}

.navigation path {
  fill: #868686;
}


.navigation p.text {
  font-size: 0.8rem;
}

div.progress.box.screen {
  background: #fff;
  transition: none;
}

div.home.box.screen {}

div.match-game.box.screen {
  background: #fff;
  transition: none;
}
